import React from 'react';

function Gif({title, id, url}){
  return (
    <div className="col-12 col-sm-6 col-md-4 col-lg-3 mb-4">
      <h4>{title}</h4>
      <img src={url} alt={title}></img>

    </div>
  )
}

export default Gif;
